<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>JS-面向对象</title>
</head>

<body>
    <div id ="container"> </div>

    <script>

        console.log("hello" === "hello");// true
        console.log({} === {});//false
        console.log(function(){} === function(){});//false

    </script>
</body>

</html>
